function keyPressed(){if("s"==key&&(keyIsDown(91)||keyIsDown(93)))return saveArtwork(),!1}function saveArtwork(){var e=new Date,a=["sunday","monday","tuesday","wednesday","thursday","friday","saturday"][e.getDay()]+"_"+["january","february","march","april","may","june","july","august","september","october","november","december"][e.getMonth()]+"_"+e.getDate()+"_"+e.getFullYear()+"_"+e.getHours()+"_"+e.getMinutes()+"_"+e.getSeconds()+".png";save(a),console.log("saved "+a)}